ale_range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1494298","type":"CustomJS"},{"attributes":{},"id":"1494165","type":"BasicTicker"},{"attributes":{"toolbar":{"id":"1494346"}},"id":"1494347","type":"ToolbarBox"},{"attributes":{},"id":"1494326","type":"AllLabels"},{"attributes":{"coordinates":null,"data_source":{"id":"1494144"},"glyph":{"id":"1494216"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1494218"},"nonselection_glyph":{"id":"1494217"},"view":{"id":"1494220"}},"id":"1494219","type":"GlyphRenderer"},{"attributes":{"axis":{"id":"1494164"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1494167","type":"Grid"},{"attributes":{},"id":"1494121","type":"BasicTicker"},{"attributes":{},"id":"1494239","type":"Selection"},{"attributes":{},"id":"1494116","type":"LinearScale"},{"attributes":{"source":{"id":"149
